import React from "react";

//pass down q, handleInputChange, handleFormSubmit as props
function Form(props) {
  return (
    <form>
      <div className="form-group">
        <label htmlFor="Query">
          <strong>Book</strong>
        </label>
        <input
          className="form-control"
          id="Title"
          type="text"
          value=""
          placeholder="Ready Player One"
          name="q"
          onChange={props.handleFormSubmit}
          required=""
        />
      </div>
      <div className="pull-right">{props.button}</div>
    </form>
  );
}

export default Form;
